import './normilize.css';
import './App.css';

function App() {

  const logoSize = 100

  return (

    <div className="App">
      <div className='main-container'>
        <div className='initials'>
          <h1 id='content' className='name'>Your Name</h1>
          <h2 id='content' className='profession'>Senior Software Engineer</h2>
          <div className='expirience'>
            <h3 id='content' className='expirience-start'>EXPIRIENCE</h3> {/* bэтот класс надо переимновать TODO */}
            <div className='expirience-list'>
            <AboutWork
                workName="Senior UI/UX Designer"
                workDuration="2 года"
                workDescription="Создание интерфейсов и дизайна сайтов, адаптивная верстка, дизайн сайтов, дизайн сайтов"
                enterpriseName="TechCorp"
              /><AboutWork
              workName="Senior UI/UX Designer"
              workDuration="2 года"
              workDescription="Создание интерфейсов и дизайна сайтов, адаптивная верстка, дизайн сайтов, дизайн сайтов"
              enterpriseName="TechCorp"
            />
            </div>
          </div>
        </div>
        <div className='logo-overlay'>
          <img className="myLogo" src={`https://static7.vivoo.ru/datas/photos/80x80/18/ed/ef85103be2a896f1960a96fbadd1.jpg?0`} height={logoSize} width={logoSize} alt='my logo'></img>

        </div>
      </div> 
    </div>
  );
}

function AboutWork({
  workName = 'work name',
  workDuration = 'work duration',
  workDescription = 'work description',
  enterpriseName = 'enterprise name',
}) {
  return (
    <div className='work'>
      <h3 className='work-name'>{workName}</h3>
      <p className='work-duration'>{workDuration} - {enterpriseName}</p>
      <p className='enterprise-name'></p>
      <p className='work-description'>{workDescription}</p>
    </div>
  );
}


export default App;
